import React from 'react';
import { NavLink } from 'react-router-dom';
import img1 from '../Images/miles2.jpg';
import Same from './Same';

const About=()=>{
    return(
        <>
           <Same
           title="About Simbarashe Lungu"
           text="“Hello, I’m Piero, and I’m passionate about building things for the web. 
                I started my journey as a developer when I was a kid. 
                I found a tutorial on how to use Visual Basic to display a 
                flower on my computer screen, and once that happened, 
                I was completely hooked to the world of computers."
           imgsrc={img1}
            btn="Know more"
           />

       </>
    )
}
export default About;
